    .background path {

      display: table;

      width: 150px !important;
      min-width: 150px;

    }

    .OA_twowayselect_right {
      width: 150px !important;
      min-width: 150px;

    }

    .OA_twowayselect_middle {
      width: 30px !important;
      max-width: 30px;
      margin: auto;
    }

      margin-top: 30px;
    }

    .debrmanager_dialog_q_text {
      font-weight: bold;
      font-size: 14px;
    }

    .debrmanager_dialog_q_choice {
      margin-top: 7px;
    }

    .debrmanager_dialog_container {
      background-color: #f8efc0;
    }

    .sslmanager_dialog_container {

    }

    .sslmanager_dialog_q {

    .sslmanager_dialog_q_text {
      font-weight: bold;
      font-size: 14px;
    }

    .sslmanager_dialog_q_choice {
      margin-top: 7px;

      fill: #d95f0e;

      opacity: 0.8;
    }

    .corrbrush_panel .ellrect {
      fill: #fff7bc !important;

      opacity: 0.8;
    }

    .body_ {
      width: 150px;
      height: 150px;

    }

    .panelbackground {
      fill: #ffffbf;
    }

    .ellipseline {
      stroke: #fc8d59;
      stroke-width: 1.5px;
    }

    .arrow {
      stroke-width: 0.5;
      stroke: #000;

    #arrow {
      stroke-width: 0.5;
    }

    .gaussianline {
      stroke: #00f;
      fill: none;

    .cluster_brush_handle {

    .gmmline {
      stroke: #00f;
